import PropTypes from 'prop-types'

const Header = (props) =>
{
  return (
    <header className='header'>
      <h1>Task Tracker: {props.title}</h1>
      <button>Add</button>
    </header>);
}

Header.defaultProps = {
  title: 'This is a default title'
}

Header.propTypes = {
  title: PropTypes.string.isRequired
}

export default Header
